import React from "react"
import './App.css';
import Flashcards from "./Flashcard";

import Header from "./Header"

function App(){
  return (
    <div className="App">
      <Header />
      <body>
        <div id="bg">
        <Flashcards />
        </div>
      </body>
    </div>
  )
}

export default App;
